import PantryItemAddBar from "./PantryItemAddBar";
import PantryCategoryHeader from "./PantryCategoryHeader";
import PantryItemInStock from "./PantryItemInStock";
import PantryItemNotInStock from "./PantryItemNotInStock";


function PantryCategoryContainer (props) {
    return (
        <section className={props.cat.toLowerCase() + "-section pantry-category"}>
            <PantryCategoryHeader />
            <PantryItemAddBar />
            {props.enteredItems[0]["items"].map((item) => (
                (item.category === props.cat && cat !== "Saved Items" && item.inStock) ? <PantryItem inStock={true} item={item} />
                : (cat === "Saved Items" && !item.inStock) ? <PantryItem inStock={false} item={item} cat={props.cat}/>
                : null 
            ))}
        </section>
    );
}

export default PantryCategoryContainer
